import React from "react";
import PropTypes from "prop-types";

const Select = ({ value, data, placeholder, onChange, onClick }) => {
  const selectChangeHandler = (e) => {
    const { value, sortedFunc } = e.target;
    onChange(value);
    onClick(sortedFunc);
  };

  return (
    <div>
      <select value={value}  className="form-control" onChange={selectChangeHandler}>
        <option value="">{placeholder}</option>
        {data.map((item, key) => (
          <option key={key} value={item.value} onClick={selectChangeHandler}>
            {item.label}
          </option>
        ))}
      </select>
    </div>
  );
};

Select.propTypes = {
  value: PropTypes.string,
  data: PropTypes.array.isRequired,
  placeholder: PropTypes.string,
  onChange: PropTypes.func.isRequired,
  onClick: PropTypes.func.isRequired,
};

Select.defaultTypes = {
  value: "",
  placeHolder: "",
};

export default Select;
